import React from 'react';

function Forms() {
  return (
    <form>
      <div>
        <input
          type="number"
          placeholder="insira altura da primeira parede"
        />
        <input
          type="number"
          placeholder="insira largura da primeira parede"
        />
      </div>
    </form>
  );
}

export default Forms;
